var tuliSrc = 'data:image/png;base64,';
var tuliImg = new Image();
var image = new Image();

tuliImg.src = tuliSrc;
var canvas = document.createElement("canvas");
var canvasContext = canvas.getContext("2d");

chrome.runtime.onMessage.addListener(
  function(request, sender, sendResponse) {

    if (request.message !== "tulify_url") return;

    image.onload = function () {

      if (image.naturalHeight < 32 && image.naturalWidth < 32) {
        return sendResponse({data: null});
      }

      var tuliWidth, tuliHeight;

      canvas.width = request.width;
      canvas.height = request.height;

      canvasContext.clearRect(0 , 0 , canvas.width, canvas.height);
      canvasContext.drawImage(image, 0, 0, canvas.width, canvas.height);

      if (canvas.height > canvas.width) {
        tuliWidth = canvas.width * 0.6;
        tuliHeight = tuliImg.height * (tuliWidth / tuliImg.naturalWidth);
      } else {
        tuliHeight = canvas.height * 0.6;
        tuliWidth = tuliImg.width * (tuliHeight / tuliImg.naturalHeight);
      }

      canvasContext.drawImage(tuliImg, canvas.width - tuliWidth, 0, tuliWidth, tuliHeight);

      sendResponse({data: canvas.toDataURL('image/png')});

    };

    image.src = request.url;

    return true;
  }
);